import LeagueBar from "./LeagueBar";
import {useState} from 'react';
const LeagueSection = () => {
    const [leagueState, setLeagueState] = useState("league");

    return (
        <div id = "LeagueSection">
            <div>
                <h2>Leagues</h2>
                <LeagueBar func = {setLeagueState}></LeagueBar>
            </div>

            { (leagueState === "league") ? <FriendScroll type = "friend"></FriendScroll> : <></>}
            { (leagueState === "") ? <FriendScroll type = "sent"></FriendScroll> : <></>}
            { (leagueState === "") ? <FriendScroll type = "received"></FriendScroll> : <></>}
            { (leagueState === "") ? <FriendScroll type = "blocked"></FriendScroll> : <></>}
            { (leagueState === "") ? <FriendAdd></FriendAdd> : <></>}

        </div>
        )
}

export default LeagueSection;
